import React, { Component } from 'react'
import './ImgSlideBar.css'

export default class ImgSlideBar extends Component {

    render() {

        const img = [
            {
                id:1,
                img: <img src="https://static.bangkokpost.com/media/content/dcx/2020/02/07/3517079.jpg"  alt="" />
            },
            {
                id:2,
                img: <img src="https://cf.bstatic.com/images/hotel/max1280x900/991/9918189.jpg"  alt="" />
            },
            {
                id:3,
                img: <img src="https://media-cdn.tripadvisor.com/media/photo-s/0e/65/a7/24/best-western-premier.jpg"  alt="" />
            }
        ];

        img.forEach(e=>
            e.img
            )

        return (
            <div className="imgslide">

            </div>
        )
    }
}
